// card.js
import React from 'react';

const Card = (props) => {
  return (
    <div className="card">
      <div className="profile-icon">
        <img src="profile-image.jpg" alt="Profile" />
      </div>
      <h3>{props.title}</h3>
      <p>{props.paragraph1}</p>
      <p>{props.paragraph2}</p>
    </div>
  );
};

export default Card;
